import sys
from io import StringIO
import unittest


class TestClass(unittest.TestCase):
    maxDiff=None
    def assertIO(self, input, output):
        stdout, stdin = sys.stdout, sys.stdin
        sys.stdout, sys.stdin = StringIO(), StringIO(input)
        resolve()
        sys.stdout.seek(0)
        out = sys.stdout.read()[:-1]
        sys.stdout, sys.stdin = stdout, stdin
        self.assertEqual(out, output)

    def test_Sample_Input_1(self):
        input = """aba
4"""
        output = """b"""
        self.assertIO(input, output)

    def test_Sample_Input_2(self):
        input = """atcoderandatcodeer
5"""
        output = """andat"""
        self.assertIO(input, output)

    def test_Sample_Input_3(self):
        input = """z
1"""
        output = """z"""
        self.assertIO(input, output)

    def test_Sample_Input_4(self):
        input = """
5"""
        output = """cb"""
        self.assertIO(input, output)

def resolve():
  # 1<=K<=5 とかなり狭いので、それを上手く使いたい。
  # 各文字の index 集めて、その index 開始の substring を set に入れて重複消して辞書順 K 番目をとる。
  S = list(input())
  K = int(input())

  num2alpha = lambda c: chr(c+97)
  # 各文字がどのインデックスにあるか数える。
  initial_index = {}
  for i in range(26): initial_index[num2alpha(i)] = []

  for i in range(len(S)):
    initial_index[S[i]].append(i)

  # 答えの候補
  candidates = set()
  for i in range(26):
    key = num2alpha(i)
    indexes = initial_index[num2alpha(i)]
    if len(indexes) == 0: continue
    candidates.add(key)
    if len(candidates) >= K:
      print(sorted(list(candidates))[K-1])
      return
    # 1 文字は確実に重複するので、2 文字から開始する。
    # K<=5 なので、2 ~ 5 文字で探索すれば十分。
    # 例えば "a"*5000 の文字列だと 4999+4998+4997+4996 < 20000 回の計算で済むので間に合いそう。
    # ローカルでワーストケース "z"*5000 で試してみたら 0.123 sec でいけたので間に合う。
    # 2 ~ 5 文字なら全探索でも間に合うのでは・・・？文字列ソートが怪しいけど。
    for length in range(2, 6):
      for index in indexes:
        if index+length <= len(S): candidates.add("".join(S[index:index+length]))
    # 頭文字を変更する前に確認する。
    if len(candidates) >= K:
      print(sorted(list(candidates))[K-1])
      return

resolve()

if __name__ == "__main__":
    unittest.main()